import React from 'react';
import { Link } from 'react-router-dom';
import Footer from '../components/Footer';

function Profile() {
  const userEmail = JSON.parse(localStorage.getItem('user'));

  return (
    <>
      <div>
        <span data-testid="profile-email">{userEmail.email}</span>
      </div>
      <Link to="/receitas-feitas" data-testid="profile-done-btn">Receitas Feitas</Link>
      <button type="button" data-testid="profile-favorite-btn">Receitas Favoritas</button>
      <button type="button" data-testid="profile-logout-btn">Sair</button>
      <Footer />
    </>
  );
}

export default Profile;
